  true,\n\t\"url\": null,\n\t\"notes\": \"The MMS consists of three major systems:
  an air-motion sensing system to measure air velocity with respect to the aircraft,
  an aircraft-motion sensing system to measure the aircraft velocity with respect
  to the earth, and a data acquisition system to sample, process, and record the measured
  quantities.  The air-motion system consists of two airflow-angle probes, three total
  temperature probes each with a different response time, a pitot-static pressure
  probe, and a dedicated static pressure system. All probes and sensors are judiciously
  located at specific positions of the fuselage. The aircraft-motion sensing system
  consists of an embedded GPS ring laser inertial navigation system, and a multiple-antenna
  GPS attitude reference system. Customized software was developed to control, sample,
  and process all sensors and hardware.\",\n\t\"owner_org\": \"d8a6202b-c0c3-463d-88a0-3bc021a178ed\",\n\t\"extras\":
